function checkCredentials() {

  // Pobierz wartości wpisane przez użytkownika
  var email = document.getElementById("email_input").value;
  var password = document.getElementById("password_input").value;

  //Dodać walidacje z bazą danych

if (email === "123" && password === "123") {
  window.location.href = "/WebApplication/screenAfterLogin.html";
} else {
  alert("Nieprawidłowy email lub hasło. Spróbuj ponownie.");
}

}
function App() {
  return (
    <div className="App">
      <head>
        <link rel="stylesheet" href="css/loginScreen_styles.css"></link>
    <title>TeeplanLogin</title>
</head>
<body>
    <div id="middle_container">
        <div id="icon_container"></div>
        <div id="login_containers">
            <div id="insert_email">
                <input id="email_input" type="email" placeholder="E-mail" required></input>
            </div>
            <div id="insert_password">
                <input id="password_input" type="password" placeholder="Password"required></input>
            </div>
            <div id="login_button" onclick="checkCredentials()">
                    <p>log in</p>
            </div>
        </div>
    </div>
</body>
    </div>
  );
}

export default App;
